<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Streamtape.com</title>
    <style>
        * {
            outline: 0 !important
        }

        .plyr-container {
            width: 100% !important;
            height: 100% !important;
        }

        body {
            height: 100%;
            width: 100%;
            margin: 0;
            overflow: hidden;
            margin: 0;
            background-color: #ffffff
        }

        html {
            height: 100%;
            width: 100%;
        }

        .grecaptcha-badge {
            visibility: hidden;
        }

        .text-center {
            width: 100%;
            height: 100%;
            text-align: center;
            display: flex;
            justify-content: center;
            align-content: center;
            flex-direction: column;
        }

            .text-center * {
                display: block;
            }

            .text-center .w {
                font-weight: bold;
                font-size: 40px;
                font-family: -apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,"Helvetica Neue",Arial,"Noto Sans",sans-serif,"Apple Color Emoji","Segoe UI Emoji","Segoe UI Symbol","Noto Color Emoji";
                color: #222;
                font-weight: bold;
            }

            .text-center .subh.w {
                font-weight: normal;
                font-size: 20px;
            }

        body.loader {
            display: flex;
            height: 100vh;
            justify-content: center;
            align-items: center;
            background: #222;
        }

        .loading {
            display: flex;
            animation-delay: 1s;
        }

            .loading .dot {
                position: relative;
                width: 2em;
                height: 2em;
                margin: 0.8em;
                border-radius: 50%;
            }

                .loading .dot::before {
                    position: absolute;
                    content: "";
                    width: 100%;
                    height: 100%;
                    background: inherit;
                    border-radius: inherit;
                    animation: wave 2s ease-out infinite;
                }

                .loading .dot:nth-child(1) {
                    background: #4433ff;
                }

                    .loading .dot:nth-child(1)::before {
                        animation-delay: 0.2s;
                    }

                .loading .dot:nth-child(2) {
                    background: #4d3dff;
                }

                    .loading .dot:nth-child(2)::before {
                        animation-delay: 0.4s;
                    }

                .loading .dot:nth-child(3) {
                    background: #5747ff;
                }

                    .loading .dot:nth-child(3)::before {
                        animation-delay: 0.6s;
                    }

                .loading .dot:nth-child(4) {
                    background: #6052ff;
                }

                    .loading .dot:nth-child(4)::before {
                        animation-delay: 0.8s;
                    }

                .loading .dot:nth-child(5) {
                    background: #695cff;
                }

                    .loading .dot:nth-child(5)::before {
                        animation-delay: 1s;
                    }

        @keyframes wave {
            50%, 75% {
                transform: scale(2.5);
            }

            80%, 100% {
                opacity: 0;
            }
        }
    </style>
